// Procesar archivos del batch actual
const items = [];

for (const item of $input.all()) {
  try {
    // Verificar si hay datos binarios
    if (!item.binary || !item.binary.data) {
      items.push({
        json: {
          originalName: item.json.name || 'Sin nombre',
          fileId: item.json.id,
          error: 'No hay datos binarios disponibles',
          status: 'error'
        }
      });
      continue;
    }

    const binaryData = item.binary.data;
    const jsonContent = Buffer.from(binaryData.data, 'base64').toString('utf8');

    // Parsear el JSON
    let parsedContent;
    try {
      parsedContent = JSON.parse(jsonContent);
    } catch (e) {
      parsedContent = { raw: jsonContent };
    }

    // Preparar datos para el an√°lisis
    // Limitar a 3000 caracteres para no exceder tokens
    const contentSummary = JSON.stringify(parsedContent, null, 2).substring(0, 3000);

    items.push({
      json: {
        originalName: item.json.name || 'Sin nombre',
        fileId: item.json.id,
        jsonContent: parsedContent,
        contentSummary: contentSummary,
        status: 'ready',
        batchInfo: {
          batchSize: $input.all().length,
          itemIndex: items.length + 1
        }
      }
    });

  } catch (error) {
    // Si falla el procesamiento, registrar el error
    items.push({
      json: {
        originalName: item.json.name || 'Sin nombre',
        fileId: item.json.id,
        error: error.message,
        status: 'error'
      }
    });
  }
}

return items;

